import React, { useState } from "react";

function ToggleSwitch(props) {
  const [checked, setChecked] = useState(props.initialChecked);

  function handleChange() {
    setChecked(!checked);
    if (props.onChange) {
      props.onChange(!checked);
    }
  }

  return (
    <div className="toggle-switch">
      <label className="switch">
        <input type="checkbox" checked={checked} onChange={handleChange} />
        <span className="slider round"></span>
      </label>
      <span>{checked ? props.labelOn : props.labelOff}</span>
    </div>
  );
}

function ProfilePage() {
  const [showDonors, setShowDonors] = useState(true);

  function handleDonorToggle(checked) {
    setShowDonors(checked);
  }

  return (
    <div>
      <h1>User Profile</h1>
      <p>Profile information goes here...</p>
      <div className="toggle-container">
        <span>Toggle Available Donors:</span>
        <ToggleSwitch
          initialChecked={showDonors}
          labelOn="Show"
          labelOff="Hide"
          onChange={handleDonorToggle}
        />
      </div>
      {showDonors && <AvailableDonors />}
    </div>
  );
}

export default Login;
